import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ConnectWallet from './ConnectWallet';
import UploadProjects from './UploadProjects';
import ExploreProjects from './ExploreProjects';
import SolveIssues from './SolveIssues';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <a href="/upload-projects">Upload Projects</a>
          <a href="/explore-projects">Explore Projects</a>
          <a href="/solve-issues">Solve Issues</a>
        </nav>
        <Routes>
          <Route path="/" element={<ConnectWallet />} />
          <Route path="/upload-projects" element={<UploadProjects />} />
          <Route path="/explore-projects" element={<ExploreProjects />} />
          <Route path="/solve-issues" element={<SolveIssues />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
